import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { ShoppingCart, User } from 'lucide-react';

// Create placeholder components for testing
const Header = () => <header className="bg-white shadow-sm py-4">Header</header>;
const Footer = () => <footer className="bg-gray-100 py-4">Footer</footer>;

// Create placeholder page components
const HomePage = () => <div>Home Page</div>;
const CategoryPage = () => <div>Category Page</div>;
const RegularProductList = () => <div>Regular Product List</div>;
const RegularProductPage = () => <div>Regular Product Page</div>;
const EmergencyProductList = () => <div>Emergency Product List</div>;
const EmergencyProductPage = () => <div>Emergency Product Page</div>;
const CartPage = () => <div>Cart Page</div>;
const RegularCheckoutPage = () => <div>Regular Checkout Page</div>;
const EmergencyCheckoutPage = () => <div>Emergency Checkout Page</div>;
const OrderConfirmationPage = () => <div>Order Confirmation Page</div>;
const UserProfilePage = () => <div>User Profile Page</div>;
const SubscriptionPage = () => <div>Subscription Page</div>;

const App = () => {
  return (
    <Router>
      <div className="min-h-screen bg-gray-50 flex flex-col">
        <Header />
        
        <main className="flex-grow container mx-auto px-4 py-8">
          <Routes>
            <Route path="/" element={<HomePage />} />
            <Route path="/categories" element={<CategoryPage />} />
            <Route path="/products" element={<RegularProductList />} />
            <Route path="/product/:id" element={<RegularProductPage />} />
            <Route path="/emergency-products" element={<EmergencyProductList />} />
            <Route path="/emergency-product/:id" element={<EmergencyProductPage />} />
            <Route path="/cart" element={<CartPage />} />
            <Route path="/checkout" element={<RegularCheckoutPage />} />
            <Route path="/emergency-checkout" element={<EmergencyCheckoutPage />} />
            <Route path="/order-confirmation" element={<OrderConfirmationPage />} />
            <Route path="/profile" element={<UserProfilePage />} />
            <Route path="/subscription" element={<SubscriptionPage />} />
          </Routes>
        </main>

        <Footer />
      </div>
    </Router>
  );
};

export default App;
